import React from "react";

function App() {
  return (
    <div>
      <div style={({ border: "solid" }, { width: "100vw" })}>
        <h1 class="title red">Votre nom ici</h1>

        <img src="/image1.png"></img>

        <img src="/image2.png"></img>
      </div>
    </div>
  );
}

export default App;
